<style>
    *{
      margin: 0px;
      padding: 0px;
    }
    
    /*Welcome*/
    #welcome-section{
      background-image: linear-gradient(to bottom right,rgb(0,5,43), rgb(0,24,210));
      width: 100%;
      color: white;
      height: 100vh;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
    /*End Welcome*/
    
    /*Projects*/
    #projects{
      /*background-color: rgb(133,133,133);*/
      background-image: linear-gradient(to bottom right,rgb(170,170,170), rgb(80,80,80));
      height: 920px;
    }
    
    #project-header{
      text-align: center;
      padding-top: 10px;
      font-size: 40px;
      color: #F1FFAA;
      border-bottom: solid;
      padding-bottom: 10px;
    }
    
    .project-tile{
      display: block;
      text-align: center;
      max-width: 350px;
      margin: 50px 0px 0px 50px;
      border-radius: 3%;
      box-shadow: 0 10px 10px rgba(0,0,0,0.2);
    }
    
    #tile-and-cap{
      position: relative;
      display: flex;
      flex-direction: column;
      /*justify-content: center;*/
      align-items: center;
      margin-left: -50px;
    }
    
    #caption{
      background-color: rgb(60,60,60);
      position: relative;
      font-size: 24px;
      color: white;
      top: -20px;
      left: 50px;
      width: 350px;
      text-align: center;
      border-radius: 25%;
      text-decoration: underline;
      text-decoration-color: rgb(60,60,60);
    }
    
    /*End Projects*/
    
    /*navbar*/
    #navbar{
      position: fixed;
      top: 0px;
      height: 50px;
      background-color: black;
      width: 100%;
      text-align: center;
      padding-top: 10px;
    }
    
    .nav-style{
      font-family: monospace;
      text-decoration: none;
      color: green;
      font-size: 32px;
      padding-left: 6px;
      padding-right: 6px;
    }
    
    .nav-style-mid{
      font-family: monospace;
      text-decoration: none;
      color: green;
      font-size: 32px;
      padding-left: 6px;
      padding-right: 6px;
      border-right: solid;
      border-left: solid;
      margin-left: -4px;
      margin-right: -3px;
    }
    /*navbar*/
    
    /*profile*/
    #profile-header{
      color: rgb(170,170,170);
      text-align: center;
      font-size: 36px;
      padding-top: 10px;
      padding-bottom: 10px;
    }
    
    #profile{
      height: 200px;
      /*background-image: linear-gradient(to bottom right,rgb(0,5,43), rgb(0,24,210));*/
      background-color: rgb(40,40,40);
    }
    
    #profile-link{
      display: block;
      text-align: center;
      font-size: 24px;
      color: white;
      padding-bottom: 20px;
    }

        font-size: 16px;
